import React from 'react'
import { Element } from 'react-scroll'
import ShowUser from "../../components/showUser/index.js"

const RegForm = () => {
  return (
    <Element name = "regform" className='showuser'>
        <ShowUser/>
    </Element>
  )
}

export default RegForm
